//var key = require('../utils/key');
var sync = require('synchronize');
var request = require('request');
var _ = require('underscore');


// The Type Ahead API.
module.exports = function(req, res) {
  var term = req.query.text.trim();
  if (!term) {
    res.json([{
      title: '<i>search your contacts (or superheroes)</i>',
      text: ''
    }]);
    return;
  }

  // TODO: Search user's actual google contact list (requires auth)

  var sampleResponse = [
    {name:"Clark Kent", email:"superman@gmail.com", imageUrl: "data:image/jpeg;base64,"},    
    {name:"Bruce Wayne", email:"batman@gmail.com", imageUrl: "data:image/jpeg;base64,"},
    {name:"Thor", email:"thor@gmail.com", imageUrl: "data:image/jpeg;base64,"},
    {name:"Tony Stark", email:"ironman@gmail.com", imageUrl: "data:image/jpeg;base64,"},
    {name:"Peter Parker", email:"spiderman@gmail.com", imageUrl: "data:image/jpeg;base64,"},
    {name:"Bruce Banner", email:"hulk@gmail.com", imageUrl: "data:image/jpeg;base64,"},
    {name:"Black Widow", email:"blackwidow@gmail.com", imageUrl: "data:image/jpeg;base64,"},
    {name:"Nick Fury", email:"nickfury@gmail.com", imageUrl: "data:image/jpeg;base64,"},
    {name:"James Logan", email:"wolverine@gmail.com", imageUrl: "data:image/jpeg;base64,"},
    {name:"Wade Wilson", email:"deadpool@gmail.com", imageUrl: "data:image/jpeg;base64,"}
  ];  

  var results = _.chain(sampleResponse)
    .reject(function(contact) {
      return (contact.name.toUpperCase().indexOf(term.toUpperCase()) === -1 && contact.email.toUpperCase().indexOf(term.toUpperCase()) === -1);
    })
    .map(function(contact) {
      return {
        title: '\
          <div style="min-height: 50px;font-family: \'proxima-nova\', \'Avenir Next\', \'Segoe UI\', \'Calibri\', \'Helvetica Neue\', Helvetica, Arial, sans-serif;">\
            <img src="' + contact.imageUrl + '" style="float: left; width: 45px; border-radius: 100px;"/>\
            <div id="name-email-container" style="float: left; margin-left: 10px; margin-top: 5px;">\
              <div id="name" style="float: left; font-size: 12pt; font-weight: 600; font-">' + contact.name + '</div><br>\
              <div id="email" style="float: left; font-size: 10pt;"><i>' + contact.email + '</i></div>\
            </div>\
          </div>\
        ',
        text: '@@@' + contact.name + '@@@' + contact.email + '@@@'
      };
    })
    .value();

  if (results.length === 0) {
    res.json([{
      title: '<i>(no results)</i>',
      text: ''
    }]);
  } else {
    res.json(results);
  }


};
